import React, { useState, useEffect } from 'react';
import axios from 'axios';

export default function MultiStepForm() {
  const [step, setStep] = useState(1);
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    wheels: 0, // Changed to integer
    type: '',
    model: '',
  });
  const [vehicleTypes, setVehicleTypes] = useState([]);
  const [typeOptions, setTypeOptions] = useState([]);

  // Fetch vehicle types on component mount
  useEffect(() => {
    axios.get('https://octalogic-test-frontend.vercel.app/api/v1/vehicleTypes')
      .then((response) => {
        setVehicleTypes(response.data);
      })
      .catch((error) => {
        console.error('Error fetching vehicle types:', error);
      });
  }, []);

  // Filter vehicle types based on selected number of wheels
  useEffect(() => {
    if (formData.wheels === 0) {
      setTypeOptions([]);
    } else {
      const filteredTypes = vehicleTypes.filter(
        (type) => type.wheels === formData.wheels
      );
      setTypeOptions(filteredTypes);
    }
  }, [formData.wheels, vehicleTypes]);

  const handleNext = () => {
    if (step === 1) {
      if (!formData.firstName || !formData.lastName) {
        alert('Please enter your full name.');
        return;
      }
    } else if (step === 2) {
      if (formData.wheels === 0) {
        alert('Please select the number of wheels.');
        return;
      }
    } else if (step === 3) {
      if (!formData.type) {
        alert('Please select a vehicle type.');
        return;
      }
    } else if (step === 4) {
      if (!formData.model) {
        alert('Please select a vehicle model.');
        return;
      }
    }
    setStep(step + 1);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Handle form submission logic here
    console.log('Form submitted:', formData);
  };

  return (
    <form onSubmit={handleSubmit}>
      {step === 1 && (
        <div>
          <input
            type="text"
            placeholder="First Name"
            value={formData.firstName}
            onChange={(e) => setFormData({ ...formData, firstName: e.target.value })}
          />
          <input
            type="text"
            placeholder="Last Name"
            value={formData.lastName}
            onChange={(e) => setFormData({ ...formData, lastName: e.target.value })}
          />
        </div>
      )}

      {step === 2 && (
        <div>
          <label>
            <input
              type="radio"
              name="wheels"
              value="2"
              checked={formData.wheels === 2}
              onChange={() => setFormData({ ...formData, wheels: 2 })}
            />
            2 Wheeler
          </label>
          <label>
            <input
              type="radio"
              name="wheels"
              value="4"
              checked={formData.wheels === 4}
              onChange={() => setFormData({ ...formData, wheels: 4 })}
            />
            4 Wheeler
          </label>
        </div>
      )}

      {step === 3 && (
        <div>
          <label>
            Select Vehicle Type
            {typeOptions.length > 0 ? (
              typeOptions.map((type) => (
                <label key={type.id}>
                  <input
                    type="radio"
                    name="type"
                    value={type.id}
                    checked={formData.type === type.id}
                    onChange={() => setFormData({ ...formData, type: type.id })}
                  />
                  {type.title}
                </label>
              ))
            ) : (
              <p>No vehicle types available for the selected number of wheels.</p>
            )}
          </label>
        </div>
      )}

      {step === 4 && (
        <div>
          {/* Model selection logic goes here */}
        </div>
      )}

      <button type="button" onClick={handleNext}>Next</button>
    </form>
  );
}


